"     </li>",
"     <li>",
"      Fentora&reg;;",
"     </li>",
"     <li>",
"      Lazanda&reg;;",
"     </li>",
"     <li>",
"      Onsolis&reg;;",
"     </li>",
"     <li>",
"      Subsys&reg;",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"list cbnlist drugH1Div drugBrandNames\" id=\"F170611\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Brand Names: Canada",
"    </span>",
"    <ul>",
"     <li>",
"      Abstral&trade;;",
"     </li>",
"     <li>",
"      Actiq&reg;;",
"     </li>",
"     <li>",
"      Apo-Fentanyl&reg; Matrix;",
"     </li>",
"     <li>",
"      Duragesic&reg;;",
"     </li>",
